import React, { useState, useEffect } from 'react';
import './App.css';
import Home from './components/Home';
import About from './components/About';
import Skills from './components/Skills';
import Projects from './components/Projects';
import Contact from './components/Contact';

function App() {
  const [activeSection, setActiveSection] = useState('home');
  const [floatingIcons, setFloatingIcons] = useState([]);

  const icons = ['ðŸ³', 'â˜ï¸', 'ðŸ”§', 'ðŸ› ï¸', 'âš™ï¸', 'ðŸ“Š', 'ðŸš€'];

  useEffect(() => {
    const createFloatingIcon = () => {
      const icon = icons[Math.floor(Math.random() * icons.length)];
      const id = Date.now() + Math.random();
      const top = Math.random() * 80 + 10;
      const duration = Math.random() * 3 + 5;

      setFloatingIcons(prev => [...prev, { id, icon, top, duration }]);

      setTimeout(() => {
        setFloatingIcons(prev => prev.filter(item => item.id !== id));
      }, duration * 1000);
    };

    const interval = setInterval(createFloatingIcon, 3000);
    return () => clearInterval(interval);
  }, []);

  const renderSection = () => {
    switch(activeSection) {
      case 'projects': return <Projects />;
      default: return <Home />;
    }
  };

  return (
    <div className="app">
      {floatingIcons.map(({ id, icon, top, duration }) => (
        <div
          key={id}
          className="floating-icon"
          style={{
            top: `${top}%`,
            animationDuration: `${duration}s`
          }}
        >
          {icon}
        </div>
      ))}

      <nav className="navbar">
        <div className="nav-links">
          <a href="#home" className={activeSection === 'home' ? 'active' : ''} onClick={() => setActiveSection('home')}>Home</a>
          <a href="#projects" className={activeSection === 'projects' ? 'active' : ''} onClick={() => setActiveSection('projects')}>Projects</a>
        </div>
      </nav>

      <div className="main-content">
        {renderSection()}
      </div>
    </div>
  );
}

export default App;
